static int test_lshl(void)
{
	uint ko = 0;
	uint j;

	for (j = 0; j < ARRAY_SIZE(vecs_lshl); j++) {
		const struct vec *vec = &vecs_lshl[j];
		u64 n = vec->val;
		int i;

		for (i = 0; i < 64; i++) {
			u64 v = vec->res[i];
			u64 r = n << i;
			if (r != v) {
				printf("#ERROR: %016llx << %d should be %016llx, not %016llx\n", n, i, v, r);
				ko++;
			}
		}
	}
	printf("Tests fail: %u, succeed: %u (lshl)\n", ko, j * 64 - ko);
	return ko;
}

